import React, { Suspense } from "react";
import { Route } from "react-router-dom";

export const Public = ({ component: Component, ...path }) => {
  return (
    <>
      <Route

        {...path}
        render={() => {
          <Suspense fallback={<div>Component Loading</div>}>
            <component />
          </Suspense>;
        }}
      />
    </>
  );
};

export default Public;
